import { Header } from "../components/Header";
import { Banner } from "../components/Banner";
import { Section } from "../components/Section";
import { Footer } from "../components/Footer";

export const Home = () => {
  // Utilisez les parenthèses pour rendre le texte et la balise <br /> en tant qu'élément JSX
  const bannerText = (
    <>
      Chez vous, <br />
      partout et ailleurs
    </>
  );

  return (
    <>
      <div className="container">
        <Header />
        <Banner image="home" text={bannerText} />
        <Section />
      </div>
      <Footer />
    </>
  );
};
